('allergy.concept.unknown','1067AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the allergy unknown concept','33fe0f23-294b-45c1-8c65-b49b7351075e',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.reaction.ConceptClasses','Symptom','A comma-separated list of the allowed concept classes for the reaction field of the allergy dialog','70638dbd-a266-4021-bc33-ce139b6978ec',NULL,NULL,NULL,NULL,NULL,NULL),('appframework.mandatory','false','true/false whether or not the appframework module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','87adb5ce-c13a-42fe-b1c8-e6917d8c1471',NULL,NULL,NULL,NULL,NULL,NULL),('appframework.started','true','DO NOT MODIFY. true/false whether or not the appframework module has been started.  This is used to make sure modules that were running  prior to a restart are started again','38f8f7ca-8586-4213-af9f-c41f032e73d2',NULL,NULL,NULL,NULL,NULL,NULL),('application.name','OpenMRS','The name of this application, as presented to the user, for example on the login and welcome pages.','eafa45ee-c9d3-4c4f-a810-2a373f6e4c35',NULL,NULL,NULL,NULL,NULL,NULL),('appointments.mandatory','false','true/false whether or not the appointments module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','b829f986-f9d9-46c5-81a4-e26937fb5a9c',NULL,NULL,NULL,NULL,NULL,NULL),('appointments.started','true','DO NOT MODIFY. true/false whether or not the appointments module has been started.  This is used to make sure modules that were running  prior to a restart are started again','249e801d-6e0e-4542-8271-f3a63a9047e2',NULL,NULL,NULL,NULL,NULL,NULL),('aqs.config.path','Configure AQS config path','Add the AQS Config path here','bfb33957-b7fb-11e4-9c67-080027b662ec',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForAppointments','/openmrs/ws/rest/v1/appointments/{uuid}','URL pattern to use for published appointment