a0',NULL,NULL,NULL,NULL,NULL,NULL),('dashboard.relationships.show_types',NULL,'Types of relationships separated by commas.  Doctor/Patient,Parent/Child','7491e8c0-3234-444d-b383-39c12796d56d',NULL,NULL,NULL,NULL,NULL,NULL),('dashboard.showPatientName','false','Whether or not to display the patient name in the patient dashboard title. Note that enabling this could be security risk if multiple users operate on the same computer.','dc57a4df-28aa-4dfc-b50d-1a8042bec54c','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('datePicker.weekStart','0','First day of the week in the date picker. Domingo/Dimanche/Sunday:0  Lunes/Lundi/Monday:1','820dab62-abee-4382-b960-4e602f8859a2',NULL,NULL,NULL,NULL,NULL,NULL),('default_locale','en','Specifies the default locale. You can specify both the language code(ISO-639) and the country code(ISO-3166), e.g. \'en_GB\' or just country: e.g. \'en\'','de5284c2-1edf-47b7-b421-c70205af8d7f',NULL,NULL,NULL,NULL,NULL,NULL),('default_location','Unknown Location','The name of the location to use as a system default','509e8f89-6b2b-40c3-9a88-6a44292d7399',NULL,NULL,NULL,NULL,NULL,NULL),('default_theme',NULL,'Default theme for users.  OpenMRS ships with themes of \'green\', \'orange\', \'purple\', and \'legacy\'','a36be38e-5bac-4a6b-811d-2a3e3236af07',NULL,NULL,NULL,NULL,NULL,NULL),('dhis.mandatory','false','true/false whether or not the dhis module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','741589f5-3c75-4a02-96f1-3ad6257e8df4',NULL,NULL,NULL,NULL,NULL,NULL),('dhis.started','true','DO NOT MODIFY. true/false whether or not the dhis module has been started.  This is used to make sure modules that were running  prior to a restart are started again','26b2da88-3895-4cf5-b2d4-e0e81a1779d6',NULL,NULL,NULL,NULL,NULL,NULL),('disableDefaultAppointmentValidations','false','Disable default appointment validations','6de3d88c-46be-41f1-bfca-88bae232dd1f',NULL,NULL,NULL,NULL,NULL,NULL),('drugOrder.drugOther','063ee60c-99a5-11e5-bbf3-080027b662ec','Specifies the uuid of the concept which represents drug other non coded','f1f00447-f3fb-41c2-99ba-96ed9086b7bb',NULL,NULL,NULL,NULL,NULL,NULL),('drugOrder.requireDrug','false','Set to value true if you need to specify a formulation(Drug) when creating a drug order.','553e98eb-9e62-4393-a7ed-7459cdd17a9d',NULL,NULL,NULL,NULL,NULL,NULL),('elisatomfeedclient.mandatory','false','true/false whether or not the elisatomfeedclient module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','46a6c514-f31a-4714-b316-d48161c83fbe',NULL,NULL,NULL,NULL,NULL,NULL),('elisatomfeedclient.started','true','DO NOT MODIFY. true/false whether or not the elisatomfeedclient module has been started.  This is used to make sure modules that were running  prior to a restart are started again','6a886279-77d2-4f90-83c7-3fbafd92ff37',NULL,NULL,NULL,NULL,NULL,NULL),('emr.admissionEncounterType','This global property had been migrated to metadata mapping in source \'org.openmrs.module.emrapi\' with code \'&s\'','UUID of the encounter type for admitting a patient','e209c792-8093-4894-86a6-de3b3eb82075',NULL,NULL,NULL,NULL,NULL,NULL),('emr.admissionForm',NULL,'UUID of the Admission Form (not required)','ef9b40fc-7e26-4011-954b-adfc4674d053',NULL,NULL,NULL,NULL,NULL,NULL),('emr.atFacilityVisitType',NULL,'UUID of the VisitType that we use for newly-created visits','7e35b5d9-f058-4f57-bdf1-f11fa08d95cd',NULL,NULL,NULL,NULL,NULL,NULL),('emr.concept.diagnosisSetOfSets','dbc2ecdb-4e14-11e4-8a57-0800271c1b75',NULL,'e0f02e9c-72a6-4f13-b619-c678af2d3609',NULL,NULL,NULL,NULL,NULL,NULL),('emr.encounterMatcher','org.bahmni.module.bahmnicore.matcher.EncounterSessionMatcher','custom encounter session matcher','81f078c9-3f10-11e4-adec-0800271c1b75',NULL,NULL,NULL,NULL,NULL,NULL),('emr.exitFromInpatientEncounterType','This global property had been migrated to metadata mapping in source \'org.openmrs.module.emrapi\' with code \'&s\'','UUID of the encounter type for exiting a patient from inpatient care','a6ae78f4-8624-4c08-ad7e-8fb847ac8fc8',NULL,NULL,NULL,NULL,NULL,NULL),('emr.exitFromInpatientForm',NULL,'UUID of the Discharge Form (not required)','53fd133c-ca9b-442e-b4de-719447cc6de8',NULL,NULL,NULL,NULL,NULL,NULL),('emr.personImagesDirectory','/home/bahmni/patient_images','Location of patient images - required by emrapi','c467177b-3f10-11e4-adec-0800271c1b75',NULL,NULL,NULL,NULL,NULL,NULL),('emr.transferWithinHospitalEncounterType',NULL,'UUID of the encounter type for transferring a patient within the hospital','b17a5357-a036-4871-9a64-74aab9ec11a5',NULL,NULL,NULL,NULL,NULL,NULL),('emr.transferWithinHospitalForm',NULL,'UUID of the Transfer Form (not required)','23489e82-8ebc-4f15-ac35-184b5e6bd3c9',NULL,NULL,NULL,NULL,NULL,NULL),('emr.unknownLocation',NULL,'UUID of the Location that represents an Unknown Location','490be82d-9831-48b5-8b1e-921a9d03b0ea',NULL,NULL,NULL,NULL,NULL,NULL),('emr.unknownProvider','f9badd80-ab76-11e2-9e96-0800200c9a66','UUID of the Provider that represents an Unknown Provider','4df46b77-962e-4ff1-98f7-27b84dadf843',NULL,NULL,NULL,NULL,NULL,NULL),('emr.visitNoteEncounterType',NULL,'UUID of the encounter type for a visit note','99c27416-f5e7-4c80-847a-87c83a5589fb',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.conceptSourcesForDiagnosisSearch','ICD-10-WHO','Specifies comma separated list of reference term source names to be used for diagnosis and condition search','d8f2118d-3ff8-49dc-a1cb-b2342e674d33',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.EmrApiVisitAssignmentHandler.encounterTypeToNewVisitTypeMap',NULL,'Specifies the mapping of encounter types to new visit types for more see https://wiki.openmrs.org/x/vgF4Aw','392c4832-daf8-427b-afb3-2a39dd497504',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.lastViewedPatientSizeLimit','50','Specifies the system wide number of patients to store as last viewed for a single user,\r\n            defaults to 50 if not specified','4262a261-ab49-4dec-bc1c-7c10687fbb76',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.mandatory','false','true/false whether or not the emrapi module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','c4c31180-3583-4ca0-849b-4340bd2bd6a4',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.nonDiagnosisConceptSets',NULL,'UUIDs or mapping of non diagnosis concept sets','6f488ef4-f8ae-4e54-b702-ecb260d8d0d7',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlGet.wardsListDetails','SELECT\n  b.bed_number AS \'Bed\',\n  concat(pn.given_name, \' \', ifnull(pn.family_name,\'\')) AS \'Name\',\n  pv.uuid AS \'Patient Uuid\',\n  pi.identifier AS \'Id\',\n  pv.gender AS \'Gender\',\n  TIMESTAMPDIFF(YEAR, pv.birthdate, CURDATE()) AS \'Age\',\n  pa.county_district AS \'District\',\n  pa.city_village AS \'Village\',\n  admission_provider_name.given_name AS \'Admission By\',\n  cast(DATE_FORMAT(latestAdmissionEncounter.max_encounter_datetime, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Admission Time\',\n  diagnosis.diagnosisConcept AS \'Diagnosis\',\n  diagnosis.certainty AS \'Diagnosis Certainty\',\n  diagnosis.diagnosisOrder AS \'Diagnosis Order\',\n  diagnosis.status AS \'Diagnosis Status\',\n  diagnosis.diagnosis_provider AS \'Diagnosis Provider\',\n  cast(DATE_FORMAT(diagnosis.diagnosis_datetime, \'%d %b %y %h:%i %p\') AS\n       CHAR) AS \'Diagnosis Datetime\',\n  dispositionInfo.providerName AS \'Disposition By\',\n  cast(DATE_FORMAT(dispositionInfo.providerDate, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Disposition Time\',\n  adtNotes.value_text AS \'ADT Notes\',\n  v.uuid AS \'Visit Uuid\'\nFROM bed_location_map blm\n  INNER JOIN bed b\n    ON blm.bed_id = b.bed_id AND\n       b.status = \'OCCUPIED\' AND\n       blm.location_id IN (SELECT child_location.location_id\n                           FROM location child_location JOIN\n                             location parent_location\n                               ON parent_location.location_id =\n                                  child_location.parent_location\n                           WHERE\n                             parent_location.name = ${location_name})\n  INNER JOIN bed_patient_assignment_map bpam ON b.bed_id = bpam.bed_id AND date_stopped IS NULL\n  INNER JOIN person pv ON pv.person_id = bpam.patient_id\n  INNER JOIN person_name pn ON pn.person_id = pv.person_id\n  INNER JOIN patient_identifier pi ON pv.person_id = pi.patient_id\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n  INNER JOIN global_property gp on gp.property=\'bahmni.primaryIdentifierType\' and gp.property_value=pit.uuid\n  LEFT JOIN person_address pa ON pa.person_id = pv.person_id\n  INNER JOIN (SELECT\n                patient_id,\n                max(encounter_datetime) AS max_encounter_datetime,\n                max(visit_id) as visit_id,\n                max(encounter_id) AS encounter_id\n              FROM encounter\n                INNER JOIN encounter_type ON encounter_type.encounter_type_id = encounter.encounter_type\n              WHERE encounter_type.name = \'ADMISSION\'\n              GROUP BY patient_id) latestAdmissionEncounter ON pv.person_id = latestAdmissionEncounter.patient_id\n  INNER JOIN visit v ON latestAdmissionEncounter.visit_id = v.visit_id\n  LEFT OUTER JOIN obs adtNotes\n    ON adtNotes.encounter_id = latestAdmissionEncounter.encounter_id AND adtNotes.voided = 0 AND\n       adtNotes.concept_id = (SELECT concept_id\n                              FROM concept_name\n                              WHERE name = \'Adt Notes\' AND concept_name_type = \'FULLY_SPECIFIED\')\n  LEFT OUTER JOIN encounter_provider ep ON ep.encounter_id = latestAdmissionEncounter.encounter_id\n  LEFT OUTER JOIN provider admission_provider ON admission_provider.provider_id = ep.provider_id\n  LEFT OUTER JOIN person_name admission_provider_name\n    ON admission_provider_name.person_id = admission_provider.person_id\n  LEFT OUTER JOIN (\n                    SELECT\n                      bpam.patient_id AS person_id,\n                      concept_name.name AS disposition,\n                      latestDisposition.obs_datetime AS providerDate,\n                      person_name.given_name AS providerName\n                    FROM bed_patient_assignment_map bpam\n                      INNER JOIN (SELECT\n                                    person_id,\n                                    max(obs_id) obs_id\n                                  FROM obs\n                                  WHERE concept_id = (SELECT concept_id\n                                                      FROM concept_name\n                                                      WHERE\n                                                        name = \'Disposition\' AND concept_name_type = \'FULLY_SPECIFIED\')\n                                  GROUP BY person_id) maxObsId ON maxObsId.person_id = bpam.patient_id\n                      INNER JOIN obs latestDisposition\n                        ON maxObsId.obs_id = latestDisposition.obs_id AND latestDisposition.voided = 0\n                      INNER JOIN concept_name ON latestDisposition.value_coded = concept_name.concept_id AND\n                                                 concept_name_type = \'FULLY_SPECIFIED\'\n                      LEFT OUTER JOIN encounter_provider ep ON latestDisposition.encounter_id = ep.encounter_id\n                      LEFT OUTER JOIN provider disp_provider ON disp_provider.provider_id = ep.provider_id\n                      LEFT OUTER JOIN person_name ON person_name.person_id = disp_provider.person_id\n                    WHERE bpam.date_stopped IS NULL\n                  ) dispositionInfo ON pv.person_id = dispositionInfo.person_id\n  LEFT OUTER JOIN (\n                    SELECT\n                      diagnosis.person_id AS person_id,\n                      diagnosis.obs_id AS obs_id,\n                      diagnosis.obs_datetime AS diagnosis_datetime,\n                      if(diagnosisConceptName.name IS NOT NULL, diagnosisConceptName.name,\n                         diagnosis.value_text) AS diagnosisConcept,\n                      certaintyConceptName.name AS certainty,\n                      diagnosisOrderConceptName.name AS diagnosisOrder,\n                      diagnosisStatusConceptName.name AS status,\n                      person_name.given_name AS diagnosis_provider\n                    FROM bed_patient_assignment_map bpam\n                      INNER JOIN visit latestVisit\n                        ON latestVisit.patient_id = bpam.patient_id AND latestVisit.date_stopped IS NULL AND\n                           bpam.date_stopped IS NULL\n                      INNER JOIN encounter ON encounter.visit_id = latestVisit.visit_id\n                      INNER JOIN obs diagnosis ON bpam.patient_id = diagnosis.person_id AND diagnosis.voided = 0 AND\n                                                  diagnosis.encounter_id = encounter.encounter_id AND\n                                                  diagnosis.concept_id IN (SELECT concept_id\n                                                                           FROM concept_name\n                                                                           WHERE name IN\n                                                                                 (\'Coded Diagnosis\', \'Non-Coded Diagnosis\')\n                                                                                 AND\n                                                                                 concept_name_type = \'FULLY_SPECIFIED\')\n                      LEFT OUTER JOIN concept_name diagnosisConceptName\n                        ON diagnosis.value_coded IS NOT NULL AND diagnosis.value_coded = diagnosisConceptName.concept_id\n                           AND diagnosisConceptName.concept_name_type = \'FULLY_SPECIFIED\'\n                      LEFT OUTER JOIN encounter_provider ep ON diagnosis.encounter_id = ep.encounter_id\n                      LEFT OUTER JOIN provider diagnosis_provider ON diagnosis_provider.provider_id = ep.provider_id\n                      LEFT OUTER JOIN person_name ON person_name.person_id = diagnosis_provider.person_id\n                      INNER JOIN obs certainty\n                        ON diagnosis.obs_group_id = certainty.obs_group_id AND certainty.voided = 0 AND\n                           certainty.concept_id = (SELECT concept_id\n                                                   FROM concept_name\n                                                   WHERE name = \'Diagnosis Certainty\' AND\n                                                         concept_name_type = \'FULLY_SPECIFIED\')\n                      LEFT OUTER JOIN concept_name certaintyConceptName\n                        ON certainty.value_coded IS NOT NULL AND certainty.value_coded = certaintyConceptName.concept_id\n                           AND certaintyConceptName.concept_name_type = \'FULLY_SPECIFIED\'\n                      INNER JOIN obs diagnosisOrder\n                        ON diagnosis.obs_group_id = diagnosisOrder.obs_group_id AND diagnosisOrder.voided = 0 AND\n                           diagnosisOrder.concept_id = (SELECT concept_id\n                                                        FROM concept_name\n                                                        WHERE name = \'Diagnosis order\' AND\n                                                              concept_name_type = \'FULLY_SPECIFIED\')\n                      LEFT OUTER JOIN concept_name diagnosisOrderConceptName ON diagnosisOrder.value_coded IS NOT NULL\n                                                                                AND diagnosisOrder.value_coded =\n                                                                                    diagnosisOrderConceptName.concept_id\n                                                                                AND\n                                                                                diagnosisOrderConceptName.concept_name_type\n                                                                                = \'FULLY_SPECIFIED\'\n                      LEFT JOIN obs diagnosisStatus\n                        ON diagnosis.obs_group_id = diagnosisStatus.obs_group_id AND diagnosisStatus.voided = 0 AND\n                           diagnosisStatus.concept_id = (SELECT concept_id\n                                                         FROM concept_name\n                                                         WHERE name = \'Bahmni Diagnosis Status\' AND\n                                                               concept_name_type = \'FULLY_SPECIFIED\')\n                      LEFT OUTER JOIN concept_name diagnosisStatusConceptName ON diagnosisStatus.value_coded IS NOT NULL\n                                                                                 AND diagnosisStatus.value_coded =\n                                                                                     diagnosisStatusConceptName.concept_id\n                                                                                 AND\n                                                                                 diagnosisStatusConceptName.concept_name_type\n                                                                                 = \'FULLY_SPECIFIED\'\n                  ) diagnosis ON diagnosis.person_id = pv.person_id','Sql query to get list of wards','a3a0105b-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.activePatients','select distinct\n          concat(pn.given_name,\' \', ifnull(pn.family_name,\'\')) as name,\n          pi.identifier as identifier,\n          concat(\"\",p.uuid) as uuid,\n          concat(\"\",v.uuid) as activeVisitUuid,\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\n        from visit v\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\n        join patient_identifier pi on v.patient_id = pi.patient_id\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n        join global_property gp on gp.property=\"bahmni.primaryIdentifierType\" and gp.property_value=pit.uuid\n        join person p on p.person_id = v.patient_id\n        join location l on l.uuid = ${visit_location_uuid} and v.location_id = l.location_id\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id = (\n          select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\"\n        ) and va.voided = 0\n        where v.date_stopped is null AND v.voided = 0','Sql query to get list of active patients','a39dcdbc-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.activePatientsByLocation','select distinct concat(pn.given_name,\" \", ifnull(pn.family_name,\'\')) as name,\n pi.identifier as identifier,\n concat(\"\",p.uuid) as uuid,\n concat(\"\",v.uuid) as activeVisitUuid,\n IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\n from\n   visit v join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 and v.voided=0\n   join patient_identifier pi on v.patient_id = pi.patient_id and pi.voided=0\n   join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n   join global_property gp on gp.property=\"bahmni.primaryIdentifierType\" and gp.property_value=pit.uuid\n   join person p on p.person_id = v.patient_id  and p.voided=0\n   join encounter en on en.visit_id = v.visit_id and en.voided=0\n   left outer join location loc on en.location_id = loc.location_id\n   join encounter_provider ep on ep.encounter_id = en.encounter_id  and ep.voided=0\n   join provider pr on ep.provider_id=pr.provider_id and pr.retired=0\n   join person per on pr.person_id=per.person_id and per.voided=0\n   left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id = (\n                select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\"\n            )\n where\n   v.date_stopped is null and\n   loc.uuid=${location_uuid}\n   order by en.encounter_datetime desc','SQL query to get list of active patients by location','a39e4a30-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.activePatientsByProvider','\n  select distinct concat(pn.given_name,\" \", ifnull(pn.family_name,\'\')) as name,\n  pi.identifier as identifier,\n  concat(\"\",p.uuid) as uuid,\n  concat(\"\",v.uuid) as activeVisitUuid,\n  IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\n  from\n    visit v join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 and v.voided=0\n    join patient_identifier pi on v.patient_id = pi.patient_id and pi.voided=0\n    join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n    join global_property gp on gp.property=\"bahmni.primaryIdentifierType\" and gp.property_value=pit.uuid\n    join person p on p.person_id = v.patient_id  and p.voided=0\n    join encounter en on en.visit_id = v.visit_id and en.voided=0\n    join encounter_provider ep on ep.encounter_id = en.encounter_id  and ep.voided=0\n    join provider pr on ep.provider_id=pr.provider_id and pr.retired=0\n    join person per on pr.person_id=per.person_id and per.voided=0\n    join location l on l.uuid=${visit_location_uuid} and l.location_id = v.location_id\n    left outer join visit_attribute va on va.visit_id = v.visit_id and va.voided = 0 and va.attribute_type_id = (\n				select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\"\n			)\n  where\n    v.date_stopped is null and\n    pr.uuid=${provider_uuid}\n    order by en.encounter_datetime desc','Sql query to get list of active patients by provider uuid','a39de90e-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.additionalSearchHandler','cn.name = \'${testName}\'','Sql query to get list of admitted patients','03be7b86-102c-11e5-b1c7-080027b662ec',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.admittedPatients','select distinct\n          concat(pn.given_name,\" \", ifnull(pn.family_name,\'\')) as name,\n          pi.identifier as identifier,\n          concat(\"\",p.uuid) as uuid,\n          concat(\"\",v.uuid) as activeVisitUuid,\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\n        from visit v\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\n        join patient_identifier pi on v.patient_id = pi.patient_id\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n        join global_property gp on gp.property=\"bahmni.primaryIdentifierType\" and gp.property_value=pit.uuid\n        join person p on v.patient_id = p.person_id\n        join visit_attribute va on v.visit_id = va.visit_id and va.value_reference = \"Admitted\" and va.voided = 0\n        join visit_attribute_type vat on vat.visit_attribute_type_id = va.attribute_type_id and vat.name = \"Admission Status\"\n        join location l on l.uuid=${visit_location_uuid} and v.location_id = l.location_id\n        where v.date_stopped is null AND v.voided = 0','Sql query to get list of admitted patients','a39e1622-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.highRiskPatients','SELECT DISTINCT\n  concat(pn.given_name, \" \", ifnull(pn.family_name,\'\'))           AS name,\n  pi.identifier                                        AS identifier,\n  concat(\"\", p.uuid)                                   AS uuid,\n  concat(\"\", v.uuid)                                   AS activeVisitUuid,\n  IF(va.value_reference = \"Admitted\", \"true\", \"false\") AS hasBeenAdmitted\nFROM person p\n  INNER JOIN person_name pn ON pn.person_id = p.person_id\n  INNER JOIN patient_identifier pi ON pn.person_id = pi.patient_id\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n  INNER JOIN global_property gp on gp.property=\"bahmni.primaryIdentifierType\" and gp.property_value=pit.uuid\n  INNER JOIN visit v ON v.patient_id = p.person_id AND v.date_stopped IS NULL AND v.voided = 0\n  INNER JOIN (SELECT\n                max(test_obs.obs_group_id) AS max_id,\n                test_obs.concept_id,\n                test_obs.person_id\n              FROM obs test_obs\n                INNER JOIN concept c ON c.concept_id = test_obs.concept_id AND test_obs.voided = 0\n                INNER JOIN concept_name cn\n                  ON c.concept_id = cn.concept_id AND cn.concept_name_type = \"FULLY_SPECIFIED\" AND\n                     cn.name IN (${testName})\n              GROUP BY test_obs.person_id, test_obs.concept_id) AS tests ON tests.person_id = v.patient_id\n  INNER JOIN obs abnormal_obs\n    ON abnormal_obs.obs_group_id = tests.max_id AND abnormal_obs.value_coded = 1 AND abnormal_obs.voided = 0\n  INNER JOIN concept abnormal_concept ON abnormal_concept.concept_id = abnormal_obs.concept_id\n  INNER JOIN concept_name abnormal_concept_name\n    ON abnormal_concept.concept_id = abnormal_concept_name.concept_id AND\n       abnormal_concept_name.concept_name_type = \"FULLY_SPECIFIED\" AND\n       abnormal_concept_name.name IN (\"LAB_ABNORMAL\")\n  LEFT OUTER JOIN visit_attribute va ON va.visit_id = v.visit_id AND va.attribute_type_id =\n                                                                     (SELECT visit_attribute_type_id\n                                                                      FROM visit_attribute_type\n                                                                      WHERE name = \"Admission Status\")','SQL QUERY TO get LIST of patients with high risk','a39e72ab-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.otScheduledQueue','SELECT\n  pi.identifier                              AS PATIENT_LISTING_QUEUES_HEADER_IDENTIFIER,\n  CONCAT(pn.given_name, \' \', pn.family_name) AS PATIENT_LISTING_QUEUES_HEADER_NAME,\n  DATE_FORMAT(sb.start_datetime, \'%d/%m/%Y\') AS `Date of Surgery`,\n  l.name                                     AS Location,\n  providerNames.provider_name                AS `Primary provider`,\n  p.uuid                                     AS uuid\nFROM surgical_block sb\n  INNER JOIN surgical_appointment sa ON sb.surgical_block_id = sa.surgical_block_id\n                                        AND sb.voided IS FALSE\n                                        AND sa.voided IS FALSE\n                                        AND sa.status = \'SCHEDULED\'\n  INNER JOIN person p ON p.person_id = sa.patient_id AND p.voided IS FALSE\n  INNER JOIN person_name pn ON pn.person_id = sa.patient_id\n                               AND pn.voided IS FALSE\n  INNER JOIN patient_identifier pi ON pi.patient_id = pn.person_id AND pi.voided IS FALSE\n  INNER JOIN patient_identifier_type pit ON pi.identifier_type = pit.patient_identifier_type_id AND\n                                            pit.name = \'Patient Identifier\'\n  INNER JOIN location l ON sb.location_id = l.location_id AND l.retired IS FALSE\n  INNER JOIN (\n               SELECT\n                 p2.provider_id,\n                 pn2.person_id,\n                 CONCAT(pn2.given_name, \' \', pn2.family_name) AS provider_name\n               FROM provider p2\n                 INNER JOIN person_name pn2 ON pn2.person_id = p2.person_id AND\n                                               p2.retired IS FALSE AND pn2.voided IS FALSE\n             ) providerNames ON providerNames.provider_id = sb.primary_provider_id\nORDER BY sb.start_datetime DESC;','SQL for scheduled patient listing queues for OT module','0ef87c0f-0849-11eb-a9e8-080027c205d3',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsHasPendingOrders','select distinct\n          concat(pn.given_name, \" \", ifnull(pn.family_name,\'\')) as name,\n          pi.identifier as identifier,\n          concat(\"\",p.uuid) as uuid,\n          concat(\"\",v.uuid) as activeVisitUuid,\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\n        from visit v\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\n        join patient_identifier pi on v.patient_id = pi.patient_id\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n        join global_property gp on gp.property=\"bahmni.primaryIdentifierType\" and gp.property_value=pit.uuid\n        join person p on p.person_id = v.patient_id\n        join orders on orders.patient_id = v.patient_id\n        join order_type on orders.order_type_id = order_type.order_type_id and order_type.name != \"Order\" and order_type.name != \"Drug Order\"\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.voided = 0 and va.attribute_type_id =\n          (select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\")\n        where v.date_stopped is null AND v.voided = 0 and order_id not in\n          (select obs.order_id\n            from obs\n          where person_id = pn.person_id and order_id = orders.order_id)','Sql query to get list of patients who has pending orders','a39e87a3-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsToAdmit','select distinct concat(pn.given_name,\' \', ifnull(pn.family_name,\'\')) as name,\n        pi.identifier as identifier,\n        concat(\"\",p.uuid) as uuid,\n        concat(\"\",v.uuid) as activeVisitUuid\n        from visit v\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 AND v.voided = 0\n        join patient_identifier pi on v.patient_id = pi.patient_id\n        join patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n        join global_property gp on gp.property=\"bahmni.primaryIdentifierType\" and gp.property_value=pit.uuid\n        join person p on v.patient_id = p.person_id\n        join encounter e on v.visit_id = e.visit_id\n        join obs o on e.encounter_id = o.encounter_id and o.voided = 0\n        join concept c on o.value_coded = c.concept_id\n        join concept_name cn on c.concept_id = cn.concept_id\n        join location l on l.uuid=${visit_location_uuid} and v.location_id = l.location_id\n        where v.date_stopped is null and cn.name = \'Admit Patient\' and v.visit_id not in (select visit_id\n        from encounter ie join encounter_type iet\n        on iet.encounter_type_id = ie.encounter_type\n        where iet.name = \'ADMISSION\')','Sql query to get list of patients to be admitted','a39dffe3-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsToDischarge','SELECT DISTINCT\n          concat(pn.given_name, \' \', ifnull(pn.family_name,\'\')) AS name,\n          pi.identifier AS identifier,\n          concat(\"\", p.uuid) AS uuid,\n          concat(\"\", v.uuid) AS activeVisitUuid,\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\n        FROM visit v\n        INNER JOIN person_name pn ON v.patient_id = pn.person_id and pn.voided is FALSE\n        INNER JOIN patient_identifier pi ON v.patient_id = pi.patient_id and pi.voided is FALSE\n        INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n        INNER JOIN global_property gp on gp.property=\"bahmni.primaryIdentifierType\" and gp.property_value=pit.uuid\n        INNER JOIN person p ON v.patient_id = p.person_id\n        Inner Join (SELECT DISTINCT v.visit_id\n          FROM encounter en\n          INNER JOIN visit v ON v.visit_id = en.visit_id AND en.encounter_type =\n            (SELECT encounter_type_id\n              FROM encounter_type\n            WHERE name = \"ADMISSION\")) v1 on v1.visit_id = v.visit_id\n        INNER JOIN encounter e ON v.visit_id = e.visit_id\n        INNER JOIN obs o ON e.encounter_id = o.encounter_id\n        INNER JOIN concept_name cn ON o.value_coded = cn.concept_id AND cn.concept_name_type = \"FULLY_SPECIFIED\" AND cn.voided is FALSE\n        JOIN location l on l.uuid=${visit_location_uuid} and v.location_id = l.location_id\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id =\n          (select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\")\n        LEFT OUTER JOIN encounter e1 ON e1.visit_id = v.visit_id AND e1.encounter_type = (\n          SELECT encounter_type_id\n            FROM encounter_type\n          WHERE name = \"DISCHARGE\") AND e1.voided is FALSE\n        WHERE v.date_stopped IS NULL AND v.voided = 0 AND o.voided = 0 AND cn.name = \"Discharge Patient\" AND e1.encounter_id IS NULL','Sql query to get list of patients to discharge','a39e3195-c70d-11e7-aa2b-8e7070d6a3d1',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.started','true','DO NOT MODIFY. true/false whether or not the emrapi module has been started.  This is used to make sure modules that were running  prior to a restart are started again','f3ce398a-c275-4744-a727-cb02ac5d709d',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.suppressedDiagnosisConcepts',NULL,'UUIDs or mappings of suppressed diagnosis concepts','b339beb8-f6d3-41d9-a5fa-827c14756f2f',NULL,NULL,NULL,NULL,NULL,NULL),('emrapi.visitExpireHours','24','Number of hours after which visit can be auto closed','c22c5a73-3f10-11e4-adec-0800271c1b75',NULL,NULL,NULL,NULL,NULL,NULL),('encounter.feed.publish.url','/openmrs/ws/rest/v1/bahmnicore/bahmniencounter/%s?includeAll=true','Url to be published on encounter save.','242982b8-8a92-11e4-977f-0800271c1b75',NULL,NULL,NULL,NULL,NULL,NULL),('encounterForm.obsSortOrder','number','The sort order for the obs listed on the encounter edit form.  \'number\' sorts on the associated numbering from the form schema.  \'weight\' sorts on the order displayed in the form schema.','de214640-9698-40c0-8b9e-6c1cf53ce4c3',NULL,NULL,NULL,NULL,NULL,NULL),('encounterModifier.groovy.allowCaching','true','Allow Groovy Caching','e16605a1-266a-47cb-8385-d07742646640',NULL,NULL,NULL,NULL,NULL,NULL),('EncounterType.encounterTypes.locked','false','saving, retiring or deleting an Encounter Type is not permitted, if true','a23b0d0f-5a6d-4190-8b46-c2207ef5d370','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('episodes.mandatory','false','true/false whether or not the episodes module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','deadd888-e1e7-44a5-a671-138c2a1998e4',NULL,NULL,NULL,NULL,NULL,NULL),('episodes.started','true','DO NOT MODIFY. true/false whether or not the episodes module has been started.  This is used to make sure modules that were running  prior to a restart are started again','d4fec83a-e7f5-47c4-ba51-8cce103aa33c',NULL,NULL,NULL,NULL,NULL,NULL),('event.ActiveMQDataDirectory','activemq-default-data','Directory where activeMQ files will be stored.','d8852aae-4778-44e0-b94f-625099459c3b',NULL,NULL,NULL,NULL,NULL,NULL),('event.mandatory','false','true/false whether or not the event module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','bca3d36b-b680-44e4-8065-6993412169d6',NULL,NULL,NULL,NULL,NULL,NULL),('event.started','true','DO NOT MODIFY. true/false whether or not the event module has been started.  This is used to make sure modules that were running  prior to a restart are started again','5dcd8d6b-4f9b-4d9b-a866-74fe998f0680',NULL,NULL,NULL,NULL,NULL,NULL),('Form.forms.locked','false','Set to a value of true if you do not want any changes to be made on forms, else set to false.','993197ed-e8da-42de-8b62-1d00c33ad498',NULL,NULL,NULL,NULL,NULL,NULL),('FormEntry.enableDashboardTab','true','true/false whether or not to show a Form Entry tab on the patient dashboard','792466d4-2eee-4dc7-b934-3fa6dfef9a67','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('FormEntry.enableOnEncounterTab','false','true/false whether or not to show a Enter Form button on the encounters tab of the patient dashboard','5e4abcdd-46ec-4925-b99a-8a55e33cd3e7','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('forms.locked','false','Set to a value of true if you do not want any changes to be made on forms, else set to false.','4a47af93-ec78-49fb-b9d6-07a5ad53d6b3',NULL,NULL,NULL,NULL,NULL,NULL),('graph.color.absolute','rgb(20,20,20)','Color of the \'invalid\' section of numeric graphs on the patient dashboard.','6819ac4b-2dda-4e5c-a822-7583a4988316',NULL,NULL,NULL,NULL,NULL,NULL),('graph.color.critical','rgb(200,0,0)','Color of the \'critical\' section of numeric graphs on the patient dashboard.','322e459a-aed4-4e0f-ae70-9130d1f6156c',NULL,NULL,NULL,NULL,NULL,NULL),('graph.color.normal','rgb(255,126,0)','Color of the \'normal\' section of numeric graphs on the patient dashboard.','792feb98-9434-41d1-a588-d02f0f509397',NULL,NULL,NULL,NULL,NULL,NULL),('gzip.enabled','false','Set to \'true\' to turn on OpenMRS\'s gzip filter, and have the webapp compress data before sending it to any client that supports it. Generally use this if you are running Tomcat standalone. If you are running Tomcat behind Apache, then you\'d want to use Apache to do gzip compression.','9e7bfcbf-3f84-4c13-8f65-4bb460841663','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('hl7_archive.dir','hl7_archives','The default name or absolute path for the folder where to write the hl7_in_archives.','a1a70f16-733f-48ba-9701-82877156ab04',NULL,NULL,NULL,NULL,NULL,NULL),('hl