\n      <property name=\"latitude\" value=\"10\"/>\r\n      <property name=\"cityVillage\" value=\"10\"/>\r\n    </sizeMappings>\r\n    <lineByLineFormat>\r\n      <string>address1</string>\r\n      <string>address2</string>\r\n      <string>cityVillage stateProvince country postalCode</string>\r\n      <string>latitude longitude</string>\r\n      <string>startDate endDate</string>\r\n    </lineByLineFormat>\r\n  </org.openmrs.layout.address.AddressTemplate>','XML description of address formats','494499c0-23fe-4a9e-b6f0-eeaeb04cf3b2',NULL,NULL,NULL,NULL,NULL,NULL),('layout.name.format','short','Format in which to display the person names.  Valid values are short, long','623aad31-3143-422a-9f37-d21c99c6ccd2',NULL,NULL,NULL,NULL,NULL,NULL),('legacyui.mandatory','false','true/false whether or not the legacyui module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','8fd39c14-eb45-468b-a5e5-f207e25ba87c',NULL,NULL,NULL,NULL,NULL,NULL),('legacyui.started','true','DO NOT MODIFY. true/false whether or not the legacyui module has been started.  This is used to make sure modules that were running  prior to a restart are started again','f2038149-4c27-417b-91b1-5c31ccba4d82',NULL,NULL,NULL,NULL,NULL,NULL),('locale.allowed.list','en','Comma delimited list of locales allowed for use on system','99f24877-92ff-435c-8429-4a7ae3773f4e',NULL,NULL,NULL,NULL,NULL,NULL),('location.field.style','tree','Type of widget to use for location fields','d65fb5b9-20b1-484c-9e1b-7643fbe16d04',NULL,NULL,NULL,NULL,NULL,NULL),('log.layout','%p - %C{1}.%M(%L) |%d{ISO8601}| %m%n','A log layout pattern which is used by the OpenMRS file appender.','67171cd3-108f-4a25-985a-8b0555b5b352',NULL,NULL,NULL,NULL,NULL,NULL),('log.level','org.openmrs.api:warn','Logging levels for log4j.xml. Valid format is class:level,class:level. If class not specified, \'org.openmrs.api\' presumed. Valid levels are trace, debug, info, warn, error 